### Other Solution
'''
- 내가 걸을 수 있는 걸음수 = k 
- 한칸씩 걷는다고 가정하고, 더 큰 걸음이 가능한 경우 이것을 선택한다.
- 그러나 이것은 오른쪽으로만 걷는 전제하에서 동작한다. 
class Solution:
    def canJump(self, nums: List[int]) -> bool:
        if len(nums)==1:
            return True
        k = nums[0]
        for i in range(len(nums)-1):
            if nums[i] > k:
                k = nums[i]
            k = k - 1
            if k < 0 :
                return False
        return True
'''
